import logo from './logo.svg';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom"
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          {/* landing page */}
          <Route path = "/" />
          {/* bistro order */}
          <Route path = "/bistro_order" />
          <Route path = "/cart" />
        </Routes>
      </Router>
    </div>
  );
}


export default App;
